import Header from "../Components/Header";
import  Container from "react-bootstrap/Container";
import PlayerCard from "../Components/PlayerCard";
import img from "../images/head.svg"

function Squad() {

    const squadStats = [
        {img: {img}, name: 'Jake', pace: 99, dribbling: 76, shooting: 89, defending: 99, passing: 78, physical: 99},
        {img: {img}, name: 'John', pace: 90, dribbling: 87, shooting: 54, defending: 78, passing: 78, physical: 99},
        {img: {img}, name: 'Mike', pace: 56, dribbling: 34, shooting: 78, defending: 78, passing: 78, physical: 99},
        {img: {img}, name: 'Josh', pace: 67, dribbling: 67, shooting: 89, defending: 90, passing: 78, physical: 99},
    ]

    return(
        <div className="App">
            <Header />
            <h1>Squad Page</h1>
            <Container id="squadCardContainer">
                {squadStats.map((x) => {
                    return(
                        <PlayerCard
                            img={x.img}
                            name={x.name}
                            pace={x.pace}
                            dribbling={x.dribbling}
                            shooting={x.shooting}
                            defending={x.defending}
                            passing={x.passing}
                            physical={x.physical}
                        />    
                    )
                })}
            </Container>
        </div>
    )
}

export default Squad;
